Guten Morgen <U+0001F1E9><U+0001F1EA>!
@otto_de hat völlig recht: Wer Gender-Sprech ablehnt, muss tatsächlich nicht bei diesem Unternehmen bestellen! Wer beim Ausgeben seines Geldes verschont bleiben möchte von moralinsaurer linksgrüner Volkserziehung, hat genug Alternativen.
<U+27A1>https://t.co/oe40rJFb9t https://t.co/c6Vl3wNWUY

Guten Morgen <U+0001F1E9><U+0001F1EA>!
@HeikoMaas, Traumtänzer im Amt des Außenministers, will #Taliban sagen, was erlaubt ist: „Vor allem die Taliban müssen zur Kenntnis nehmen, dass es ein Zurück ins Jahr 2001 nicht geben wird.“ Nun sitzen Deutsche in Todesangst in #Kabul!
<U+27A1><U+FE0F> https://t.co/whA59prpfv https://t.co/a5ePK4lu8S

Guten Morgen <U+0001F1E9><U+0001F1EA>!
@_FriedrichMerz strebt eine Koalition mit den linksradikalen, ökosozialistischen „Grünen“ an - damit ist völlig klar: In der Union gibt es NIEMANDEN mehr, der für eine konservative Wende eintritt. 
<U+27A1>https://t.co/FRLgTIDvA6 https://t.co/fVNwhqlNHA

Guten Morgen <U+0001F1E9><U+0001F1EA>!
@Sven_Giegold, Grünen-Sprecher im EU-Parlament, hält die Arbeit von Flüchtlingsorganisationen (korrekter wäre: Schlepperorg.!) für „gottgewollt“. Unsere #Bürgerpartei dagegen sagt: Schluss mit der illegalen Einwanderung in unser Land!
<U+27A1>https://t.co/uV9opp9B9k https://t.co/jQoOAinn6j

Guten Morgen <U+0001F1E9><U+0001F1EA>!
@sebastiankurz hat recht - geben wir jetzt Erdogans Druck nach, dann kommen Hunderttausende und das Europa ohne Grenzen nach innen wird Geschichte sein. Die "Grünen" wollen dem Druck nachgeben - sie machen sich zum Handlanger Erdogans.
<U+27A1>https://t.co/SYjVhkIFfe https://t.co/fB4BoXfQYi

Guten Morgen <U+0001F1E9><U+0001F1EA>! 
@SarrazinThilo warnt die #SPD davor, zu einer Sekte zu werden. Grund: Sie will die unangenehmen Wahrheiten zur #Masseneinwanderung nicht mehr zur Kenntnis nehmen. Realitätsverweigerung hat auf Dauer noch nie funktioniert!
<U+27A1>https://t.co/Wafzr4eur0 https://t.co/AkXWwcBsSA

Guten Morgen <U+0001F1E9><U+0001F1EA>!
@_FriedrichMerz sucht nach Mehrheiten. Der stramme Linkskurs einer @KuehniKev-#SPD gefährdet die Stabilität von Regierung und Land. @Die_Gruenen sind auch nicht besser. Zur Erinnerung: Es gibt eine bürgerliche Mehrheit im Bundestag.
<U+27A1><U+FE0F>https://t.co/7FU3dTsHsq https://t.co/sOejrWvTcJ

Guten Morgen <U+0001F1E9><U+0001F1EA>!
